type J = JSVal -- some JS value
type A = JSVal -- array

seqTupList :: [(a,b)] -> [(a,b)]
seqTupList xs = go xs `seq` xs
  where go ((y1,y2):ys) = y1 `seq` y2 `seq` go ys
        go []           = ()

foreign import javascript unsafe "$r = [];" js_emptyArrayI :: A

buildArrayI :: [J] -> A
buildArrayI xs = unsafePerformIO (toJSArray xs)
